import React from "react";
import Typewriter from "typewriter-effect";

const Gitwrite = () => {
  return (
    <div>
      <Typewriter
        options={{
          strings: [
            "Hello",
            "wlc to my site",
            "fasting",
            "every thinks your mind",
          ],
          autoStart: true,
          loop: true,
        }}
      />
    </div>
  );
};

export default Gitwrite;
